window.bookSummaryJSON = "<p>With his wedding behind him, Fred is looking forward to nightly life finally settling down. Unfortunately, someone from his past has other, far less peaceful, plans in mind.</p> <p>Finding his clan under attack, Fred must scramble to discover who is working against him and how to fight back. Between securing shelter, trading favors, and keeping up with his accounting business, it won't be easy to stay out of trouble, let alone uncover the identity of his adversary.</p> <p>Faced with an enemy who has no interest in diplomacy, Fred and his friends will have to make hard choices if they want to survive. Choices that could forever change The House of Fred.</p>"; 
